                                                                    value='\nHolders of Annual Gold Cards and Gold Record Cards get the following discounts for journeys that start and end within the Annual Gold Card area, after 09:30am Monday-Friday or anytime weekends and Bank Holidays.\n\n1/3 off:\n\nStandard and First Class Anytime and Off-Peak tickets for the cardholder and up to three adults travelling with them\nOff-Peak Day Travelcard Zones 1-6    \nOyster Off-Peak pay as you go single fares and the pay as you go daily price cap for journeys on National Rail, London Underground and Docklands Light Railway services. The Annual Gold Card discount will need to be set on an Oyster card. You can ask staff at London Underground, London Overground, TfL Rail and some National Rail stations in the London area to set the discount for you.\nAnytime Day Travelcards when bought as part of your ticket to London from outside London Zones 1-9 (subject to time restrictions and a £17 minimum fare)\nPLUSBUS Day tickets in the Network Railcard area\nPLUS:\n\nUp to 60% off Child fares for up to four children aged between 5 and 15 years (subject to a £1 minimum fare)\nChildren aged under 5 years travel free of charge\nAdditional one year Railcard for £10 for any nominated person (including yourself)*\nDiscounts on journeys to the Isle of Wight using Wightlink, Red Funnel and HoverTravel (when purchased as part of through journey including National Rail)\n* choose from a 16-25, Family and Friends, Senior, Two Together, Disabled Persons or Network Railcard. You can purchase one discounted Railcard, subject to eligibility, anytime during the validity of your Annual Gold Card. See Discounted Railcards section for details.\n\nRestrictions\nThe maximum group size is four adults and four fare-paying children (children under 5 travel at no charge). The Annual Gold Card holder must travel with the group at all times.\n\nJourneys due to begin before 09:30am Monday-Friday\n\nAnnual Gold Card holders do not need to purchase a ticket for themselves if the journey being made is covered by their Annual Season ticket. When buying discounted Day Travelcards for accompanying adults or children, the Annual Gold Card holder must ensure their Annual Season ticket is also valid for travel in the London Fare Zone they wish to travel to, otherwise they must purchase a discounted Off-Peak Day Travelcard for themselves as well.\n\nWhen can I get the discounts?\nDiscounts are available for travel at or after 09:30am on Mondays to Fridays. Valid at any time on Saturdays, Sundays and Public Holidays.'
